    function add2() public pure returns (uint8) {
        unchecked {
            uint8 i = 240;
            uint8 j = 16;
            uint8 k = i + j;
            return k;
        }
    }

    function sub1() public pure returns (uint8) {
        unchecked {
            uint8 m = 1;
            uint8 n = m - 2;
            return n;
        }
    }
}

